import React from 'react';
import styles from './ServiceMain.module.css';
import Services from '../Services/Services';
import repair from '../../../Assets/Images/repair.png';
import phone from '../../../Assets/Images/phone.jpg';
import transfer from '../../../Assets/Images/transfer.jpeg';
import cafe from '../../../Assets/Images/cafe.jpg';



const serviceMain = () => (
    <div>
        <h2>What We Can Do For You Today...</h2>
        <div className={styles.ServicesMain}>
            <ul>
                <li><Services img={repair} title='Phone Repair'/></li>
                <li><Services img={phone} title='Browse Phone'/></li>
                <li><Services img={transfer} title='Money Transfer'/></li>
                <li><Services img={cafe} title='Cyber Cafe'/></li>
            </ul>
        </div>
    </div>
)

export default serviceMain;
